import React from 'react';
import { IoIosArrowBack } from "react-icons/io";

export const GenerateQRCode = () => {
    return (
        <div className='row' style={{}}>
            <div className='col' style={{backgroundColor: 'FFFFFF', width: '30%'}}>
                    
            </div>
            <div className='col' style={{backgroundColor: 'DFDFDF', width: '70%'}}>
                <div className='row'>
                    <div className='col'>
                        <IoIosArrowBack />
                    </div>
                    <div className='col' style={{fontSize: '32px'}}>
                        Generate QR
                    </div>
                </div>    
            </div>
        </div>
    );
}
